import React from 'react';
import { Paper, Tabs, Tab} from '@material-ui/core';
import Typography from '@material-ui/core/Typography';

export default ({muscles}) => {

    return (
        <Paper>
      <Tabs
        value={1}
        indicatorColor="primary"
        textColor="primary"
        centered
      >
        {muscles.map}
      </Tabs>
    </Paper>
    )
}
